
IFSConvert = function (mididata)
    local result = {}
    for i, v in pairs(mididata) do
        if v == 0 then
            table.insert(result, 0)
        else 
            table.insert(result, PTFreqToIFS(PTMIDIToFreq(v)))
        end
    end
    PTLog("%s", inspect(result))
    return result
end

Repeat = function (mididata, count) 
    local result = {}
    for i = 1, count do
        for j, v in pairs(mididata) do
            table.insert(result, v)
        end
    end
    return result
end

